import __NG_CLI_RESOURCE__0 from "./sidenav-list.component.html?ngResource";
import __NG_CLI_RESOURCE__1 from "./sidenav-list.component.css?ngResource";
import { Component, EventEmitter, Output } from '@angular/core';
import { AuthService } from 'src/app/auth/auth.service';
import { Subscription } from "rxjs";
let SidenavListComponent = class SidenavListComponent {
    constructor(authService) {
        this.authService = authService;
        this.closeSideNav = new EventEmitter();
        this.isAuth = false;
        this.authSubscription = new Subscription();
    }
    ngOnInit() {
        this.authSubscription = this.authService
            .authChange$
            .subscribe((authStats) => {
            this.isAuth = authStats;
        }, (error) => {
            console.log('error :', error);
        });
    }
    onLogout() {
        this.authService.logout();
        this.onClose();
    }
    onClose() {
        this.closeSideNav.emit();
    }
    ngOnDestroy() {
        this.authSubscription.unsubscribe();
    }
};
